import React from "react";
import Message from "../Message";

function Nav(props) {
  return (
    <nav className="navbar">
      <ul>
        <Message score={props.score} topScore={props.topScore} />
        <li>
          Score: {props.score} 
        </li>
        <li>
          Top Score: {props.topScore}
        </li>
      </ul>
    </nav>
  );
}

export default Nav;
